<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>6x5 Mosaic Slideshow (Single File)</title>
  <style>
    * { box-sizing: border-box; margin: 0; padding: 0; }
    html, body { height: 100%; width: 100%; overflow: hidden; font-family: sans-serif; }
    body { background: #000; color: #fff; }

    .mosaic {
      position: fixed;
      inset: 0;
      display: grid;
      grid-template-columns: repeat(6, 1fr);
      grid-template-rows: repeat(5, 1fr);
      gap: 4px;
      padding: 4px;
      z-index: -1;
      background: #000;
    }
    .tile {
      position: relative;
      overflow: hidden;
      background: #111;
      display: flex;
      align-items: center;
      justify-content: center;
    }
    .tile img {
      width: 100%;
      height: 100%;
      object-fit: fill;
      opacity: 0;
      transition: opacity .6s ease-in-out;
      position: absolute;
      inset: 0;
    }
    .tile img.active { opacity: 1; }

    .overlay {
      position: relative;
      height: 100%;
      display: flex;
      align-items: center;
      justify-content: center;
      text-align: center;
      padding: 24px;
      background: linear-gradient(180deg, rgba(0,0,0,.35), rgba(0,0,0,.2));
      pointer-events: none;
    }
    .overlay h1 {
      font-size: clamp(1.1rem, 2.6vw, 2.2rem);
      line-height: 1.35;
      max-width: 900px;
      text-shadow: 
        -1px -1px 0 #000,  
         1px -1px 0 #000,
        -1px  1px 0 #000,
         1px  1px 0 #000,
         0 0 12px rgba(0,0,0,.8);
    }
  </style>
</head>
<body>
  <div class="mosaic" id="mosaic"></div>

  <div class="overlay">
    <h1 id="message">Ya casi es tu cumpleaños! Te amo mucho! Espero que disfrutes mucho estos días y que la celebración nunca acabe. Soy dichoso de poder compartir estos momentos contigo</h1>
  </div>

    const INTERVAL_MS = 2000;
    const mosaic = document.getElementById('mosaic');

    for (let t = 0; t < 30; t++) {
      const tile = document.createElement('div');
      tile.className = 'tile';

      files.forEach((src, i) => {
        const img = document.createElement('img');
        img.src = src;
        img.alt = 'photo';
        if (i === t % files.length) img.classList.add('active');
        tile.appendChild(img);
      });

      mosaic.appendChild(tile);
    }

    setInterval(() => {
      document.querySelectorAll('.tile').forEach(tile => {
        const imgs = tile.querySelectorAll('img');
        let idx = 0;
        imgs.forEach((im, i) => { if (im.classList.contains('active')) idx = i; });
        imgs[idx].classList.remove('active');
        imgs[(idx + 1) % imgs.length].classList.add('active');
      });
    }, INTERVAL_MS);
  </script>
